import{_ as n,M as r,p as i,q as s,R as e,t as a,N as o,a1 as c}from"./framework-d81ad7e5.js";const d={},h=c('<h1 id="mac-常见问题处理" tabindex="-1"><a class="header-anchor" href="#mac-常见问题处理" aria-hidden="true">#</a> Mac 常见问题处理</h1><h2 id="修改主机名" tabindex="-1"><a class="header-anchor" href="#修改主机名" aria-hidden="true">#</a> 修改主机名</h2><p>sudo scutil --set HostName 新的主机名</p><h2 id="github-remote-permission-to-git-denied-to-user" tabindex="-1"><a class="header-anchor" href="#github-remote-permission-to-git-denied-to-user" aria-hidden="true">#</a> github remote: Permission to .git denied to user.</h2><p>解决方案</p><p>这个解决方案其实很简单。首先，我用的是mac电脑，mac电脑有个keychain的应用即钥匙串访问，这里存储了github先前访问的密码，所以每次push的时候都会读取这个本地用户名及密码，所以才被github denied。</p><p>解决步骤哦依次如下：打开 应用程序 ----&gt; 钥匙串访问 ----&gt;双击，即可进入到钥匙串访问记录保存页面，选择github.com名称的应用，右键删除即可。</p><h2 id="修改磁盘名" tabindex="-1"><a class="header-anchor" href="#修改磁盘名" aria-hidden="true">#</a> 修改磁盘名</h2><p>diskutil info disk1s1</p><p>diskutil rename oldname newname</p><h2 id="mac下解决lc-ctype警告的最简单方法" tabindex="-1"><a class="header-anchor" href="#mac下解决lc-ctype警告的最简单方法" aria-hidden="true">#</a> Mac下解决LC_CTYPE警告的最简单方法</h2>',11),l={href:"https://jingyan.baidu.com/article/fdbd4277c564c8b89e3f48eb.html",target:"_blank",rel:"noopener noreferrer"},m=e("h2",{id:"ssh连接服务器一段时间不操作之后卡死的问题",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#ssh连接服务器一段时间不操作之后卡死的问题","aria-hidden":"true"},"#"),a(" SSH连接服务器一段时间不操作之后卡死的问题")],-1),u=e("p",null,"卡死是因为LIUNX安全设置问题，在一段时间内没有使用数据的情况下会自动断开，解决方法就是让本地或者服务器隔一段时间发送一个请求给对方即可",-1),p=e("p",null,"~/.ssh/config 中增加如下配置即可。 #每隔50秒就向服务器发送一个请求 ServerAliveInterval 50 #允许超时的次数，一般都会响应 ServerAliveCountMax 3",-1);function _(f,b){const t=r("ExternalLinkIcon");return i(),s("div",null,[h,e("p",null,[e("a",l,[a("terminal 去掉set locale environment"),o(t)])]),m,u,p])}const x=n(d,[["render",_],["__file","mac-faq.html.vue"]]);export{x as default};
